\begin{abstract}
We present narrow-band Hubble Space Telescope images of the
young planetary nebula GL 618. These images have allowed us to
study the detailed morphology of shock-excited emission present in
the bipolar lobes of this object. These images reveal the presence of
three highly collimated outflows emanating from the central regions
of GL 618. We discuss the significance of the detection of these
outflows and the possible origins of these features.
\end{abstract}

